import React, { useState, useEffect } from "react";
import styled from "styled-components";
import { useNavigate } from "react-router-dom";
import Logout from "../Logout";
import { getUserSchedule } from "../../utils/APIRoutes";
import axios from "axios";
import "./Instructor.css"

import loaderImage from "../../assets/loader.gif";

const Instructor = ({}) => {
  const navigate = useNavigate();
  const [currUser, setCurrUser] = useState(undefined);
  const [schedules, setSchedules] = useState([]);
  const [loading, setLoading] = useState(true);

  const adminKey = localStorage.getItem("secret-key-admin");
  const userKey = localStorage.getItem("secret-key");

  useEffect(() => {
    if (adminKey) {
      navigate("/admin");
    } else if (userKey) {
      setCurrUser(JSON.parse(userKey).username);
    } else {
      navigate("/");
    }
  }, [navigate]);

  useEffect(() => {
    const fetchSchedules = async () => {
      try {
        const response = await axios.get(getUserSchedule, {
          params: { currUser },
        });
        setSchedules(response.data.schedules);
      } catch (error) {
        console.error("Error fetching Schedule:", error);
        console.log("Error");
      } finally {
        setLoading(false);
      }
    };
    fetchSchedules();
  }, [currUser, navigate, schedules]);

  if (loading) {
    return (
      <div className="loader-container">
      <img src={loaderImage} alt="Loading..." className="loader-image" />
    </div>
    );
  }

  return (
    <div className="welcome-container-Inst">
      <div className="top-bar-Inst">
        <Logout />
        <h1 className="heading-Inst">Welcome {currUser}</h1>
      </div>
      <div className="main-content-Inst">
        <div className="lectures-container-Inst">
          <h2 className="section-heading-Inst">Your Upcoming Lectures</h2>
          <div className="scrollable-content-Inst">
            {schedules.map((schedule, index) => (
              <div key={index} className="lecture-card-Inst">
                <h3 className="card-heading-Inst">Course:</h3>
                <p className="course-content-Inst">{schedule.course}</p>

                <h3 className="card-heading-Inst">Lecture:</h3>
                <p className="lecture-content-Inst">{schedule.lecture}</p>

                <h3 className="card-heading-Inst">Date:</h3>
                <p className="date-content-Inst">
                  {new Date(schedule.date).toLocaleDateString()}
                </p>

                <h3 className="card-heading-Inst">Location:</h3>
                <p className="location-content-Inst">{schedule.location}</p>
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
};

const LoaderContainer = styled.div`
  height: 100vh;
  display: flex;
  align-items: center;
  justify-content: center;
`;

const LoaderImage = styled.img`
  width: 80px; /* Adjust the width as needed */
  height: 80px; /* Adjust the height as needed */
`;

// ... (import statements remain the same)

const WelcomeContainer = styled.div`
  height: 100vh;
  width: 100vw;
  background-color: #4d394b; /* Charcoal Plum */
  padding-bottom: 1rem;
`;

const TopBar = styled.div`
  width: 100%;
  background: #eadce6; /* Satin Pearl */
  padding: 25px;
  display: flex;
  justify-content: space-between;
`;

const Heading = styled.h1`
  color: #fff; /* White */
  font-size: 36px;
  font-weight: bold;
  margin-top: 40px;
`;

const LecturesContainer = styled.div`
  width: 100%;
`;

const ScrollableContent = styled.div`
  display: flex;
  flex-wrap: wrap;
  justify-content: space-around;
  gap: 1rem;
  max-height: 450px;
  overflow-y: auto;
`;

const LectureCard = styled.div`
  background-color: #420f0f; /* Deep Burgundy */
  border-radius: 15px;
  padding: 25px; /* Increased padding */
  box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
  margin-top: 10px;
  width: 40%; /* Reduced width */
  box-sizing: border-box;
`;

const SectionHeading = styled.h2`
  color: #fff; /* White */
  font-size: 24px;
  margin-bottom: 15px;
`;

const CardHeading = styled.h3`
  color: #fff; /* White */
  font-size: 25px; /* Increased font size */
  margin-bottom: 10px; /* Increased margin */
`;

const CardContent = styled.p`
  margin-bottom: 15px;
  font-size: 18px; /* Increased font size */
  color: #c0c0c0; /* Silver Mist */
`;

// Apply unique styles for each card content
const CourseContent = styled(CardContent)`
  color: #ffd700; /* Lustrous Gold */
  font-weight: bold;
  font-size: 25px; /* Increased font size */
`;

const LectureContent = styled(CardContent)`
  color: #000000; /* Ivory Lace */
  font-style: italic;
  font-size: 25px; /* Increased font size */
  font-weight: bold;
`;

const DateContent = styled(CardContent)`
  color: #d4a2b0; /* Mauve Mist */
  font-weight: bold;
  font-size: 25px; /* Increased font size */
`;

const LocationContent = styled(CardContent)`
  color: #c0c0c0; /* Silver Mist */
  font-size: 16px; /* Adjusted font size */
`;

const MainContent = styled.div`
  display: flex;
  flex-wrap: wrap;
  justify-content: space-between;
  gap: 1rem;
  padding: 10px;
  overflow: hidden;
  width: 100%;
`;

export default Instructor;
